import React from 'react';
import css from '../styles/Header.module.css';
import publicUrl from '../utils/publicUrl';

function Header(props) {

  function handleClick(page) {
    console.log("clicked!", page);
    console.log("props", props.onHeaderChange());
  }

  return (
    <div className={css.header}>
      <div className={css.headerItem}>
        <button onClick={e=>handleClick("home")}>
          <img src={publicUrl('./assets/assets/camera.svg')} alt="Home"/>
        </button>  
      </div>
      <div className={css.headerItem}>
        Instagram
      </div>
      <div className={css.header-item}>
        <button onClick={e=>handleClick("home")}>
          <img src={publicUrl('./assets/assets/message.svg')} alt="Home"/>
        </button>  
      </div>
    </div>
    );
  }

  export default Header;
